import { Button, Text, View, useTheme } from '@gluestack-ui/themed';

import React from 'react';
import { GluestackUIProvider, Box, VStack } from '@gluestack-ui/themed';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Headline } from 'react-native-paper';


const TestScreen = () =>{
    const { toggleThemeType, themeType, isDarkTheme, theme } = useTheme();
    return(
  <View>
  <Button  onPress={toggleThemeType}>
    toggle theme
  </Button>
  <Headline>{themeType}</Headline>
  <Headline>isDarkTheme:{`${isDarkTheme}`}</Headline>
  <Headline>Primary: {theme.colors.primary}</Headline>
  </View>
  
    );
  };
function configuracion_usuario() {
    return <Box bg='black' h={45} w={50} justifyContent="center" alignItems="center">
        <Text color="white" fontWeight="$bold">
            BOX
        </Text>


        <TestScreen/>
    </Box>;
}

export default configuracion_usuario
